import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Game from './Game';
import Login from './Login';
import Signup from './Signup';

function App() {
  return (
    <Router>
      <Link to='/login'>Login</Link>
      <Switch>
        <Route path="/Login">
          <Login />
        </Route>
        <Route path="/signup">
          <Signup />
        </Route>
        <Route path="/game">
          <Game />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
